column8:
後付けフェンダー用の交換ゴムです。<br>
長い間使用しているとゴムが劣化したり変色してきます。<br>
フェンダーゴムを交換して見栄えも気分もリフレッシュしましょう！<br>
他社製のオーバーフェンダーやスポイラーにも流用が可能です。<br>
形状とサイズをご確認ください。<BR>
■商品名：シーリングラバー<BR>
■取付け車種：汎用<BR>
■長さ：1m単位<BR>
■素材：ラバー<BR>
■カラー：ブラック/ホワイト/ライトグレー<BR>
<BR>
カラーがブラックの場合はシーリングラバー形状は左側（角）になり<BR>
ホワイトとライトグレーの場合は右側（丸）になります。(画像参照)<br>
(備考)<BR>
フェンダーの形状によりますが、目安として1台分で約８ｍ必要になります。<br>
1m単位でのご注文になりますが、お届けはご希望の長さの１本ものでの切り売りとなります。<BR>
※商品の特性上、粉吹き等がございます。<BR>
商品に問題はございませんが、ご了承の上でご購入をお願いします。<BR><style>

